import React from 'react';
import { motion } from 'framer-motion';

const Versions = () => {
  return (
    <div className="versions-container">
      <h2>Purchase Dobby Versions</h2>
      <div className="version-cards">
        <motion.div
          className="version-card"
          whileHover={{ scale: 1.05 }}
        >
          <h3>Standard Version</h3>
          <p>Basic functionalities for personal use.</p>
          <span className="price">FREE</span>
          <button>Get Now</button>
        </motion.div>
        
        <motion.div
          className="version-card"
          whileHover={{ scale: 1.05 }}
        >
          <h3>Pro Version</h3>
          <p>Advanced features for professional use.</p>
          <span className="price">$3.5</span>
          <button>Buy Now</button>
        </motion.div>
        
        <motion.div
          className="version-card"
          whileHover={{ scale: 1.05 }}
        >
          <h3>Enterprise Version</h3>
          <p>Complete solutions with premium support.</p>
          <span className="price">$8.5</span>
          <button>Buy Now</button>
        </motion.div>
      </div>
    </div>
  );
};

export default Versions;
